NYHET! NYA GRANDLAND! ELECTRIC! FRÅN 569900:-, JUST NU 0% RÄNTA KAMPANJ! 180° backkamera inkl parkeringsradar fram och bak; Adaptiv farthållare & Stop/Go funktion;
Automatiskt helljus; Bältespåminnare, samtliga sittplatser; Elektrisk parkeringsbroms; Filbytesvarning;
Insynsskydd för bagageutrymme; Kollisionsvarnare fram; Krockkuddar fram, sida & tak samt
krockgardiner sida fram& bak; Regnsensor; Trafikskyltsavläsning; Trötthetsvarnare; Uppgraderad
autobroms och varningssensor (fotgängar- & cyklistskydd); Ytterbackspeglar, uppvärmda elektriskt
infällbara & justerbara;
Säkerhet
Fälgar & Däck 19tum lättmetallfälgar, Grå Anthra;
6 högtalare; DAB radio; Multimedia: 10tum Pekskärm Inkl. 10tum förardisplay med IVI Mid; Shark fin
antenn; Trådlös smartphone integration genom Apple Carplay och Android Auto via Bluetooth;
Media
Armstöd, skjutbart i mittkonsol fram med 2 skjutbara mugghållare; LED Strålkastare; Motoriserad
baklucka med handsfree funktion; Solskydd med sminkspegel och belysning; Uppvärmda framsäten;
Interiör & Exteriör
Ergonomiska Opel Intelli-Seats certifierade av Aktion Gesunder Rücken (AGR) med 10 vägs
justerbara stolar fram; ISO-fix fästen för barnstol, främre passagerarstol & yttrebaksäten;
Säten
Styrning Läderratt med plattbotten inkl. rattkontroller; Uppvärmd ratt;
